import React from "react";
import Logo from "../../../components/Logo";
import { Link } from "react-scroll";

const Navbar = () => {
  return (
    <nav className="bg-gray-700 my-5 mx-10 px-6 py-2 rounded-lg flex items-center justify-between">
      <Logo />
      <div>
        <Link to="Home" smooth={true} duration={500}>Home</Link>
        <Link to="why" smooth={true} duration={500}>Why Kode?</Link>
        <Link to="works" smooth={true} duration={500}>Home</Link>
        <Link to="Home" smooth={true} duration={500}>Home</Link>
        <Link to="Home" smooth={true} duration={500}>Home</Link>
        <Link to="Home" smooth={true} duration={500}>Home</Link>
      </div>
    </nav>
  );
};

export default Navbar;
